// ListaMedicamento.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function ListaMedicamento({ medicamentos }) {
  const navigate = useNavigate();

  // Exemplo de modal (opcional)
  const [modalOpen, setModalOpen] = useState(false);
  const [medicamentoSelecionado, setMedicamentoSelecionado] = useState(null);

  const abrirModal = (medicamento) => {
    setMedicamentoSelecionado(medicamento);
    setModalOpen(true);
  };

  const fecharModal = () => {
    setMedicamentoSelecionado(null);
    setModalOpen(false);
  };

  return (
    <div style={{ padding: 20, fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center', marginBottom: 20 }}>Medicamentos</h1>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        {medicamentos.map((medicamento) => (
          <div
            key={medicamento.id}
            style={{
              cursor: 'pointer',
              display: 'flex',
              flexDirection: 'row',
              border: '1px solid #ddd',
              borderRadius: 15,
              boxShadow: '0 3px 15px rgba(0,0,0,0.15)',
              padding: 15,
              marginBottom: 20,
              maxWidth: 450,
              transition: 'transform 0.2s',
            }}
            onMouseEnter={(e) => e.currentTarget.style.transform = 'scale(1.02)'}
            onMouseLeave={(e) => e.currentTarget.style.transform = 'scale(1)'}
          >
            {/* Imagem clicável */}
            <img
              src={medicamento.imageUrl}
              alt={medicamento.nome}
              style={{ width: 100, height: 100, borderRadius: 12, marginRight: 15 }}
              onClick={() => navigate(`/detalhes/${medicamento.id}`, { state: { medicamento } })}
            />

            <div style={{ flex: 1 }}>
              <h2 style={{ margin: 0 }}>{medicamento.nome}</h2>
              <p style={{ margin: '5px 0', color: '#555' }}>{medicamento.descricao}</p>
              <p style={{ fontWeight: 'bold', fontSize: 18 }}>R$ {medicamento.preco.toFixed(2)}</p>
              <div style={{ marginTop: 5 }}>
                {medicamento.maisPesquisado && (
                  <span style={{
                    backgroundColor: '#f39c12',
                    color: '#fff',
                    padding: '3px 8px',
                    borderRadius: 5,
                    fontSize: 12,
                    marginRight: 5
                  }}>Mais Pesquisado</span>
                )}
                {medicamento.topDoMomento && (
                  <span style={{
                    backgroundColor: '#27ae60',
                    color: '#fff',
                    padding: '3px 8px',
                    borderRadius: 5,
                    fontSize: 12
                  }}>Top do Momento</span>
                )}
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Modal opcional */}
      {modalOpen && (
        <div style={{
          position: 'fixed',
          top: 0, left: 0, right: 0, bottom: 0,
          backgroundColor: 'rgba(0,0,0,0.5)',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}>
          <div style={{
            backgroundColor: '#fff',
            borderRadius: 15,
            padding: 20,
            maxWidth: 500,
            width: '90%'
          }}>
            <h2>{medicamentoSelecionado.nome}</h2>
            <img src={medicamentoSelecionado.imageUrl} alt={medicamentoSelecionado.nome} style={{ width: '100%', borderRadius: 12 }} />
            <p>{medicamentoSelecionado.descricao}</p>
            <p><strong>Preço:</strong> R$ {medicamentoSelecionado.preco.toFixed(2)}</p>
            <button onClick={fecharModal} style={{ marginTop: 10, padding: '5px 10px' }}>Fechar</button>
          </div>
        </div>
      )}
    </div>
  );
}
